/*
 * Agglomerations with IAS / septic tank
 * created from:
 *   SELECT aggCode, aggName, rptMStateKey, aggRemarks FROM T_Agglomerations
 *   WHERE aggRemarks LIKE '%IAS%' OR aggRemarks LIKE '%septic%'
*/

DROP TABLE IF EXISTS "T_agg_IAS";
CREATE TABLE `T_agg_IAS` (
  `id`			     INTEGER PRIMARY KEY AUTOINCREMENT, 
  `aggCode`			 varchar, 
  `aggName`			 varchar, 
  `rptMStateKey` varchar
);
